import React from 'react';
import { useLocation } from 'react-router-dom';

const ApplicationReportBPT = () => {
  const location = useLocation();
  const formData = location.state;

  if (!formData) {
    return (
      <div style={{ padding: '20px', fontFamily: 'Arial' }}>
        <h3 style={{ color: 'red' }}>
          No data received. Please fill and submit the form first.
        </h3>
      </div>
    );
  }

  const sectionStyle = {
    border: '1px solid #ccc',
    padding: '16px',
    marginBottom: '24px',
    borderRadius: '8px',
    fontFamily: 'Arial, sans-serif',
  };

  const rowStyle = {
    display: 'flex',
    flexWrap: 'wrap',
  };

  const fieldStyle = {
    width: '48%',
    margin: '1%',
    fontSize: '14px',
  };

  const renderField = (label, value) => (
    <div style={fieldStyle}>
      <strong>{label}:</strong> {value || 'N/A'}
    </div>
  );

  return (
    <div style={{ padding: '40px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center' }}>Application Review Report</h1>
      <h2 style={{ textAlign: 'center' }}>Bachelor of Physiotherapy - 2025</h2>

      {/* Section 1 */}
      <section style={sectionStyle}>
        <h3>1. Advertisement Details</h3>
        <div style={rowStyle}>
          {renderField('Ad. No', formData.adNo)}
          {renderField('Ad. Date', formData.adDate)}
          {renderField('Application No', formData.applicationNo)}
          {renderField('Course Name', formData.courseName)}
          {renderField('Course Code', formData.courseCode)}
          {renderField('Date of Entry', formData.dateOfEntry)}
          {renderField('Last Date', formData.lastDate)}
          {renderField('Department', formData.department)}
        </div>
      </section>

      {/* Section 2 */}
      <section style={sectionStyle}>
        <h3>2. Applicant's Details</h3>
        <div style={rowStyle}>
          {renderField('Name', formData.name)}
          {renderField("Father's Name", formData.fatherName)}
          {renderField('Date of Birth', formData.dob)}
          {renderField('Age', formData.age)}
          {renderField('Place of Birth', formData.birthPlace)}
          {renderField('Social Status', formData.status)}
          {renderField('Nationality', formData.nationality)}
          {renderField('Marital Status', formData.maritalStatus)}
          {renderField('Gender', formData.gender)}
          {renderField('Differently Abled', formData.differentlyAbled)}
          {renderField('Identification Mark 1', formData.idMark1)}
          {renderField('Identification Mark 2', formData.idMark2)}
          {renderField('University Area', formData.universityArea)}
          {renderField('In Service (Govt.)', formData.inService)}
          {renderField('Aadhar', formData.aadhar)}
          {renderField("Father's Email", formData.fatherEmail)}
        </div>
      </section>

      {/* Section 3 */}
      <section style={sectionStyle}>
        <h3>3. Parents' Details</h3>
        <div style={rowStyle}>
          {renderField("Father's Name", formData.fatherName)}
          {renderField("Father's Age", formData.fatherAge)}
          {renderField("Father's Occupation", formData.fatherOccupation)}
          {renderField("Mother's Name", formData.motherName)}
          {renderField("Mother's Age", formData.motherAge)}
          {renderField("Mother's Occupation", formData.motherOccupation)}
          {renderField('Monthly Income', formData.monthlyIncome)}

        </div>

      </section>
        {/* Section 4 */}


      {/* Section 5 */}
      <section style={sectionStyle}>

        <div style={rowStyle}>
          {renderField('10th School Name', formData.tenthSchool)}
          {renderField('10th Board', formData.tenthBoard)}
          {renderField('10th Year of Passing', formData.tenthYear)}
          {renderField('10th Percentage/CGPA', formData.tenthMarks)}
          {renderField('District ', formData.tenthDistrict)}
</div>
</section>
<section style={section}>

  <div style={rowStyle}>
          {renderField('Intermediate College', formData.inter1stCollege)}
          {renderField('place', formData.inter1stplace)}
          {renderField('District ', formData.inter1stDistrict)}
          {renderField('Intermediate Year of Passing', formData.inter1Year)}
          {renderField('Intermediate Marks/CGPA', formData.interMarks)}
        </div>
      </section>
          {/* Section 4 */}
          <section style={sectionStyle}>
        <h3>4. Contact Details</h3>
        <div style={rowStyle}>
          {renderField('Mobile Number', formData.mobileno)}

          {renderField('Email', formData.email)}
          {renderField('Address Line 1', formData.address)}
          {renderField('Address Line 2', formData.address)}
          {renderField('City', formData.city)}
          {renderField('District', formData.district)}
          {renderField('State', formData.state)}
          {renderField('Pincode', formData.pincode)}
        </div>
      </section>

    </div>
  );
};

export default ApplicationReportBPT;
